//! You are given a 0-indexed binary string s and two integers minJump
//! and maxJump.
//! In the beginning, you are standing at index 0, which is equal to '0'.
//! You can move from index i to index j if the following conditions are fulfilled:
//!     i + minJump <= j <= min(i + maxJump, s.length - 1), and
//!     s[j] == '0'.
//! Return true if you can reach index s.length - 1 in s, or false otherwise.
pub struct Solution;

impl Solution {
    pub fn can_reach(s: String, min_jump: i32, max_jump: i32) -> bool {
        let s = s.chars().collect::<Vec<_>>();
        // Early abort
        if let Some(&'1') = s.last() {
            return false;
        }
        // DFS
        let mut dfs_states = vec![false; s.len()];
        let mut dfs_stack = std::collections::VecDeque::new();
        let min_jump = min_jump as usize;
        let max_jump = max_jump as usize;
        dfs_stack.push_front(0);
        while !dfs_stack.is_empty() {
            let idx = dfs_stack.pop_front().unwrap();
            if idx == s.len() - 1 {
                return true;
            }
            *dfs_states.get_mut(idx).unwrap() = true;
            s.iter()
                .enumerate()
                .skip(idx + min_jump)
                .take(max_jump - min_jump + 1)
                .for_each(|(i, c)| unsafe {
                    if c == &'0' && dfs_states.get_unchecked(i) == &false {
                        dfs_stack.push_front(i);
                        *dfs_states.get_unchecked_mut(i) = true;
                    }
                });
        }
        false
    }
}

#[cfg(test)]
mod tests {
    use crate::Solution;
    #[test]
    fn test_soln() {
        assert!(Solution::can_reach("011010".to_owned(), 2, 3));
        assert!(!Solution::can_reach("01101110".to_owned(), 2, 3));
        assert!(Solution::can_reach("0".to_owned(), 2, 3));
        assert!(!Solution::can_reach("01".to_owned(), 2, 3));
        assert!(!Solution::can_reach("00111010".to_owned(), 3, 5));
        assert!(!Solution::can_reach("".to_owned(), 3, 5));
        assert!(Solution::can_reach("".to_owned(), 5, 99998));
    }
}
